发票，不得作为税收凭证。纳税人识别号有两种方式获取：①联系公司财务咨询开票信息；②登录全国组织代码管理中心查询：//www.nacao.org.cn/",eJ="5",eK="问：为什么我的订单不支持开发票？",eL="当您的订单金额为0元或者该订单完全使用礼品卡支付的时候；或特殊渠道下单时不支持开发票。",eM="6",eN="问：为什么使用礼品卡支付时不支持开发票？",eO="在购买礼品卡时已支持开具发票，因此在使用礼品卡消费时，不再支持重复开票。",eP="7",eQ="问：什么是电子发票？",eR="电子发票是指在购销商品、提供或者接受服务以及从事其他经营活动中，开具、收取的以电子方式存储的收付款凭证。开具的电子发票均为真实有效的合法发票，与传统纸质发票具有同等法律效力。电子发票可以用于财务报销、保修和维权。根据国家税务总局公告2015年84号《关于推行通过增值税电子发票系统开具的增值税电子普通发票有关问题的公告》第三条：增值税电子普通发票的开票方和受票方需要纸质发票的，可以自行打印增值税电子普通发票的版式文件，其法律效力、基本用途、基本使用规定等与税务机关监制的增值税普通发票相同。",eS="8",eT="问：电子发票什么时候开具？",eU="电子发票将会在订单下所有包裹确认收货后开具。",eV="9",eW="问：电子发票在哪里下载？",eX="您可在电脑网页版的亮亮电商“个人中心——订单详情”中进行下载。",eY="10",eZ="问：发票丢了可以补开吗？",fa="根据国税局相关要求，对于增值税普通发票遗失，我们会向您提供发票第一联复印件并加盖发票章；对于增值税专用发票丢失的，我们会向税务局申请开具《增值税专用发票已抄报税证明单》并连同发票第一联复印件加盖发票章提供给您（请注意由此产生的运费由责任方承担）。",fb="11",fc="问：如果申请退换货，发票如何处理？",fd="您在申请退货后，已经开具的发票将会作废。如您还需要对其他商品开发票，可联系客服处理。",fe="12",ff="问：申请售后时，发票丢失了怎么办？",fg="如果申请售后的商品发票丢失，可能会在退款中扣除相应的税点。",fh="13",fi="问：为什么有些发票随箱寄送，有些没有随箱？",fj="正常情况下，纸质普通发票会随箱寄出。由于系统原因，部分特殊商品需要手工处理。该部分纸质发票会在发货后15-30个工作日单独寄出（若申请售后，需等待售后处理完毕）发票默认寄送到购买商品的收货地址，如需修改发票的邮寄地址，请联系客服处理。",fk="14",fl="问：增值税专用发票开票信息在哪填写？",fm="增值税专用发票开票信息可在下单时选择开具专票填写增票资质信息。温馨提示：请确保增票资质信息与贵司税务登记证信息一致，避免因开票信息错误给贵司带来损失。",fn="15",fo="问：年购套餐的订单发票怎么开？",fp="答：年购订单发票随每期子单寄出。",fq="免责声明：请根据自身平台的实际情况进行编写。此处仅作为交互样式参考，如果使用此处文字而产生侵权行为，产品原型概不负责。",fr="dataProps",fs="evaluatedStates",ft="u11368",fu="u11554",fv="aae254aa365c43ca85899d0434c1702e",fw=132,fx=29,fy=265,fz=227,fA="22px",fB="propagate",fC="04179c97c7704c1d91423f47f4f7b3f8",fD="返回顶部",fE=1500,fF=86,fG="b775e2723c5d48b48c978558bc9115b4",fH="masters",fI="c03b97fc1e2045c9bd424f3427a74869",fJ="Axure:Master",fK="627587b6038d43cca051c114ac41ad32",fL=0xFFFFFFFF,fM="Applied Font",fN="1480b9a201e14268923512276002f278",fO="网站头部",fP=136,fQ="1439d207f4894986990a0aa22d79838d",fR="98d85a6f0ddd44faa547b6b0adb24260",fS="Case 1",fT="Set text on Name_SubNav equal to &quot;[[Item.name]]&quot;",fU="Name_SubNav to \"[[Item.name]]\"",fV="text on Name_SubNav equal to \"[[Item.name]]\"",fW="38